INSERT INTO serialized_object (name,description,type,subtype,serialization_class,serialized_data,date_created,creator,date_changed,changed_by,retired,date_retired,retired_by,retire_reason,uuid)
VALUES ('LISTA CRIAN√áAS √ìRF√ÉOS E VULNER√ÅVEIS - OVC','LISTA CRIAN√áAS √ìRF√ÉOS E VULNER√ÅVEIS - OVC','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"1a792c80-6619-4952-81d3-2c6d7a506e95\" retired=\"false\">\n  <name>LISTA CRIAN√áAS √ìRF√ÉOS E VULNER√ÅVEIS - OVC</name>\n  <description>LISTA CRIAN√áAS √ìRF√ÉOS E VULNER√ÅVEIS - OVC</description>\n  <creator id=\"2\" uuid=\"157006ce-1d60-11e0-b929-000c29ad1d07\"/>\n  <dateCreated id=\"3\">2021-09-14 05:58:07 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2021-09-15 08:16:15 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>endDate</name>\n      <label>endDate</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>location</name>\n      <label>location</label>\n      <type>org.openmrs.Location</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>3588</id>\n  <sqlQuery>SELECT DISTINCT &#xd;\n	pid.identifier AS NID,&#xd;\n	CONCAT(IFNULL(pn.given_name,&apos;&apos;),&apos; &apos;,IFNULL(pn.middle_name,&apos;&apos;),&apos; &apos;,IFNULL(pn.family_name,&apos;&apos;)) AS &apos;NomeCompleto&apos;,&#xd;\n	p.gender,&#xd;\n	ROUND(DATEDIFF(&apos;2021-06-20&apos;,p.birthdate)/365) idade_actual,&#xd;\n	pad3.county_district AS &apos;Distrito&apos;,&#xd;\n	pad3.address2 AS &apos;PAdministrativo&apos;,&#xd;\n	pad3.address6 AS &apos;Localidade&apos;,&#xd;\n	pad3.address5 AS &apos;Bairro&apos;,&#xd;\n	pad3.address1 AS &apos;PontoReferencia&apos;,&#xd;\n	inicio_real.data_inicio AS data_inicio,&#xd;\n	IF(saida_real.estado IS NOT NULL,saida_real.estado,IF(visita.value_datetime IS NOT NULL AND&#xd;\n	DATEDIFF(&apos;2021-06-20&apos;,visita.value_datetime)&lt;28,&apos;ACTIVO&apos;,&#xd;\n	IF(visita.encounter_datetime IS NOT NULL AND DATEDIFF(&apos;2021-06-20&apos;,visita.encounter_datetime)&lt;58,&apos;ACTIVO&apos;,&#xd;\n	IF(proxima.value_datetime IS NOT NULL AND DATEDIFF(&apos;2021-06-20&apos;,proxima.value_datetime)&lt;28,&apos;ACTIVO&apos;,&#xd;\n	IF(ultimo_seguimento.data_ultimo_seguimento IS NOT NULL AND DATEDIFF(&apos;2021-06-20&apos;,ultimo_seguimento.data_ultimo_seguimento)&lt;58,&apos;ACTIVO&apos;,&apos;ABANDONO NAO NOTIFICADO&apos;))))) estado,&#xd;\n	visita.encounter_datetime AS ultimo_levantamento,&#xd;\n	visita.value_datetime AS proximo_marcado,&#xd;\n	regime.esquema ultimo_regime,&#xd;\n	IF(disp_registo.patient_id IS NOT NULL AND disp_registo.data_registo&gt;=disp_fila.data_ultimo_levantamento,disp_registo.tipo_dispensa,IF(disp_fila.patient_id IS NOT NULL,&#xd;\n	IF(DATEDIFF(disp_fila.data_proximo_levantamento,disp_fila.data_proximo_levantamento) BETWEEN 81 AND 99,&apos;DT&apos;,&apos;DS&apos;),&apos;DM&apos;)) tipo_dispensa,&#xd;\n	ultimo_seguimento.data_ultimo_seguimento AS data_ultimo_seguimento,&#xd;\n	proxima.value_datetime data_proximo_seguimento,&#xd;\n	pat.value telef_pat,&#xd;\n	pessoa_referencia.ref telef_referencia,&#xd;\n	CASE &#xd;\n	WHEN TIMESTAMPDIFF(MONTH,inicio_real.data_inicio,&apos;2021-06-20&apos;) &gt;= 6&#xd;\n		AND (( TIMESTAMPDIFF(MONTH,carga_viral.encounter_datetime,&apos;2021-06-20&apos;) &gt;= 3&#xd;\n		AND carga_viral.value_numeric&gt;=1000) OR carga_viral.patient_id IS NULL) THEN &apos;SIM&apos;&#xd;\n	WHEN TIMESTAMPDIFF(MONTH,inicio_real.data_inicio,&apos;2021-06-20&apos;) &gt;= 6&#xd;\n		AND (TIMESTAMPDIFF(MONTH,carga_viral.encounter_datetime,&apos;2021-06-20&apos;) &gt;= 12 OR carga_viral.patient_id IS NULL) THEN &apos;SIM&apos;	&#xd;\n	WHEN gravida.patient_id IS NOT NULL AND TIMESTAMPDIFF(MONTH,inicio_real.data_inicio,&apos;2021-06-20&apos;) &gt;= 3 &#xd;\n			AND (carga_viral.value_numeric&gt;=1000 OR carga_viral.patient_id IS NULL) THEN &apos;SIM&apos;&#xd;\n	ELSE &apos;NAO&apos; END AS elegivelcv,&#xd;\n	IF((carga_viral.patient_id IS NOT NULL AND pedido_CV.obs_datetime&gt;carga_viral.encounter_datetime) OR (carga_viral.patient_id IS NULL AND pedido_CV.obs_datetime IS NOT NULL) , &apos;SIM&apos;,&apos;NAO&apos;) pedido_cv,&#xd;\n	carga_viral.value_numeric AS cv,&#xd;\n	carga_viral.qualidade_carga AS qualidade_carga,&#xd;\n	carga_viral.encounter_datetime AS data_cv&#xd;\n			&#xd;\nFROM	&#xd;\n/* DATA DE INICIO DE TARV */&#xd;\n(SELECT patient_id,MIN(data_inicio) data_inicio&#xd;\n FROM&#xd;\n	&#xd;\n	(SELECT  p.patient_id,MIN(e.encounter_datetime) data_inicio&#xd;\n	FROM    patient p &#xd;\n	INNER JOIN encounter e ON p.patient_id=e.patient_id       &#xd;\n	INNER JOIN obs o ON o.encounter_id=e.encounter_id&#xd;\n	WHERE   e.voided=0 AND o.voided=0 AND p.voided=0 AND &#xd;\n	   e.encounter_type IN (6,9) AND o.concept_id=1255 AND o.value_coded=1256 AND &#xd;\n	   e.encounter_datetime&lt;=&apos;2021-06-20&apos; AND e.location_id=398&#xd;\n	GROUP BY p.patient_id&#xd;\n		&#xd;\n	UNION&#xd;\n		&#xd;\n	SELECT    p.patient_id,MIN(value_datetime) data_inicio&#xd;\n	FROM      patient p&#xd;\n	INNER JOIN encounter e ON p.patient_id=e.patient_id&#xd;\n	INNER JOIN obs o ON e.encounter_id=o.encounter_id&#xd;\n	WHERE   p.voided=0 AND e.voided=0 AND o.voided=0 AND e.encounter_type IN (18,6,9,53) AND &#xd;\n	   o.concept_id=1190 AND o.value_datetime IS NOT NULL AND &#xd;\n	   o.value_datetime&lt;=&apos;2021-06-20&apos; AND e.location_id=398&#xd;\n	GROUP BY p.patient_id&#xd;\n &#xd;\n	UNION&#xd;\n&#xd;\n	SELECT  pg.patient_id,date_enrolled data_inicio&#xd;\n	FROM    patient p INNER JOIN patient_program pg ON p.patient_id=pg.patient_id&#xd;\n	WHERE   pg.voided=0 AND p.voided=0 AND program_id=2 AND date_enrolled&lt;=&apos;2021-06-20&apos; AND location_id=398&#xd;\n							&#xd;\n	UNION&#xd;\n       						&#xd;\n	SELECT  e.patient_id, MIN(e.encounter_datetime) AS data_inicio &#xd;\n	FROM    patient p&#xd;\n	INNER JOIN encounter e ON p.patient_id=e.patient_id&#xd;\n	WHERE   p.voided=0  AND e.encounter_type = 18 AND e.voided=0 AND e.encounter_datetime&lt;=&apos;2021-06-20&apos; AND e.location_id=398&#xd;\n	GROUP BY p.patient_id&#xd;\n           &#xd;\n	UNION&#xd;\n&#xd;\n	SELECT  e.patient_id, MIN(o1.value_datetime) AS data_inicio &#xd;\n	FROM    patient p&#xd;\n	INNER JOIN encounter e ON p.patient_id=e.patient_id&#xd;\n	INNER JOIN obs o1 ON e.encounter_id=o1.encounter_id AND o1.concept_id=23866&#xd;\n	INNER JOIN obs o ON e.encounter_id=o.encounter_id AND o.concept_id=23865 AND o.value_coded=1065&#xd;\n	WHERE   p.voided=0  AND e.encounter_type=52  AND o1.voided=0  AND o.voided=0 AND e.voided=0 AND o1.value_datetime&lt;=&apos;2021-06-20&apos; AND e.location_id=398&#xd;\n	GROUP BY p.patient_id  &#xd;\n	) inicio&#xd;\nGROUP BY patient_id&#xd;\n) inicio_real&#xd;\nINNER JOIN person p ON p.person_id=inicio_real.patient_id&#xd;\nLEFT JOIN person_attribute pat ON pat.person_id=inicio_real.patient_id  AND pat.person_attribute_type_id=9 AND pat.value IS NOT NULL AND pat.value&lt;&gt;&apos;&apos; AND pat.voided=0&#xd;\n/* BUSCA DO ENDERECO */ &#xd;\nLEFT JOIN &#xd;\n(SELECT pad1.*&#xd;\n FROM person_address pad1&#xd;\n INNER JOIN &#xd;\n (&#xd;\n  SELECT person_id,MIN(person_address_id) id &#xd;\n  FROM person_address&#xd;\n  WHERE voided=0&#xd;\n  GROUP BY person_id&#xd;\n ) pad2&#xd;\nWHERE pad1.person_id=pad2.person_id AND pad1.person_address_id=pad2.id&#xd;\n) pad3 ON pad3.person_id=inicio_real.patient_id	&#xd;\n/* BUSCA DO NOME */ 			&#xd;\nLEFT JOIN 			&#xd;\n(SELECT pn1.*&#xd;\n FROM person_name pn1&#xd;\n INNER JOIN &#xd;\n (&#xd;\n  SELECT person_id,MIN(person_name_id) id &#xd;\n  FROM person_name&#xd;\n  WHERE voided=0&#xd;\n  GROUP BY person_id&#xd;\n ) pn2&#xd;\n WHERE pn1.person_id=pn2.person_id AND pn1.person_name_id=pn2.id&#xd;\n) pn ON pn.person_id=inicio_real.patient_id&#xd;\n/* BUSCA DO NID */ 			&#xd;\nLEFT JOIN&#xd;\n(SELECT pid1.*&#xd;\n FROM patient_identifier pid1&#xd;\n INNER JOIN&#xd;\n (&#xd;\n SELECT patient_id,MIN(patient_identifier_id) id&#xd;\n FROM patient_identifier&#xd;\n WHERE voided=0&#xd;\n GROUP BY patient_id&#xd;\n ) pid2&#xd;\n WHERE pid1.patient_id=pid2.patient_id AND pid1.patient_identifier_id=pid2.id&#xd;\n) pid ON pid.patient_id=inicio_real.patient_id&#xd;\n/* BUSCA DO ULTIMO LEVANTAMENTO */&#xd;\nLEFT JOIN		&#xd;\n(SELECT ultimavisita.patient_id,ultimavisita.encounter_datetime,o.value_datetime,e.location_id&#xd;\n FROM&#xd;\n (SELECT 	p.patient_id,MAX(encounter_datetime) AS encounter_datetime&#xd;\n  FROM 	encounter e &#xd;\n  INNER JOIN patient p ON p.patient_id=e.patient_id &#xd;\n  LEFT JOIN obs o ON e.encounter_id=o.encounter_id&#xd;\n  WHERE 	e.voided=0 AND p.voided=0 AND o.voided=0 AND e.encounter_type = 18 AND e.location_id=398 &#xd;\n  GROUP BY p.patient_id&#xd;\n ) ultimavisita&#xd;\n INNER JOIN encounter e ON e.patient_id=ultimavisita.patient_id AND e.encounter_datetime=ultimavisita.encounter_datetime&#xd;\n LEFT JOIN obs o ON o.encounter_id=e.encounter_id AND o.concept_id=5096 			&#xd;\n WHERE  o.voided=0 AND e.encounter_type=18 AND e.location_id=398 &#xd;\n) visita ON visita.patient_id=inicio_real.patient_id &#xd;\n/* BUSCA DO ULTIMO SEGUIMENTO/CONSULTA */		&#xd;\nLEFT JOIN &#xd;\n(  SELECT e.patient_id,	MAX(e.encounter_datetime) data_ultimo_seguimento&#xd;\n   FROM patient p&#xd;\n   INNER JOIN encounter e ON e.patient_id=p.patient_id&#xd;\n   WHERE e.encounter_datetime&lt;=&apos;2021-06-20&apos;  AND e.voided=0 AND p.voided=0 AND &#xd;\n   e.location_id=398 AND e.encounter_type IN (6,9)&#xd;\n   GROUP BY e.patient_id&#xd;\n ) ultimo_seguimento ON inicio_real.patient_id=ultimo_seguimento.patient_id&#xd;\nLEFT JOIN obs proxima ON proxima.person_id=ultimo_seguimento.patient_id AND ultimo_seguimento.data_ultimo_seguimento=proxima.value_datetime AND proxima.voided=0 AND proxima.concept_id=1410 &#xd;\n/* BUSCA DO TELEFONE DO CONTACTO */&#xd;\nLEFT JOIN &#xd;\n(SELECT patient_id,IF(o.value_text IS NOT NULL,o.value_text,o1.value_text) ref&#xd;\nFROM encounter e&#xd;\nLEFT JOIN obs o ON o.encounter_id=e.encounter_id&#xd;\nLEFT JOIN obs o1 ON o1.encounter_id=e.encounter_id&#xd;\nWHERE encounter_type IN (5,7,53) AND (o.concept_id =1611 OR o1.concept_id=6224) AND (o.voided=0 OR o1.voided=0) AND e.location_id=398 &#xd;\nGROUP BY patient_id&#xd;\n) pessoa_referencia ON pessoa_referencia.patient_id=inicio_real.patient_id&#xd;\n/* BUSCA DO ESTADO DE SAIDA */&#xd;\nLEFT JOIN	&#xd;\n(SELECT	pg.patient_id,ps.start_date encounter_datetime,location_id,&#xd;\n	CASE ps.state&#xd;\n	WHEN 7 THEN &apos;TRANSFERIDO PARA&apos;&#xd;\n	WHEN 8 THEN &apos;SUSPENSO&apos;&#xd;\n	WHEN 9 THEN &apos;ABANDONO&apos;&#xd;\n	WHEN 10 THEN &apos;OBITO&apos;&#xd;\n	ELSE &apos;OUTRO&apos; END AS estado&#xd;\nFROM 	patient p &#xd;\nINNER JOIN patient_program pg ON p.patient_id=pg.patient_id&#xd;\nINNER JOIN patient_state ps ON pg.patient_program_id=ps.patient_program_id&#xd;\nWHERE 	pg.voided=0 AND ps.voided=0 AND p.voided=0 AND ps.start_date&lt;=&apos;2021-06-20&apos; AND &#xd;\n	pg.program_id=2 AND ps.state IN (7,8,9,10) AND ps.end_date IS NULL AND location_id=398&#xd;\n) saida_real ON inicio_real.patient_id=saida_real.patient_id&#xd;\n/* BUSCA DO ULTIMO REGIME */	&#xd;\n LEFT JOIN&#xd;\n(SELECT ultimoregime.patient_id,&#xd;\n CASE o.value_coded&#xd;\nWHEN 6324 THEN &apos;TDF+3TC+EFV&apos;&#xd;\nWHEN 1651 THEN &apos;AZT+3TC+NVP&apos;&#xd;\nWHEN 6114 THEN &apos;AZT60+3TC+NVP(Douvir N Baby)&apos;&#xd;\nWHEN 23785 THEN &apos;TDF+3TC+DTG2&apos;&#xd;\nWHEN 23784 THEN &apos;TDF+3TC+DTG&apos;&#xd;\nWHEN 1703 THEN &apos;AZT+3TC+EFV&apos;&#xd;\nWHEN 1314 THEN &apos;AZT+3TC+LPV/r&apos;&#xd;\nWHEN 6243 THEN &apos;TDF+3TC+NVP&apos;&#xd;\nWHEN 6104 THEN &apos;ABC+3TC+EFV&apos;&#xd;\nWHEN 817 THEN &apos;ABC+3TC+AZT&apos;&#xd;\nWHEN 23786 THEN &apos;ABC+3TC+DTG&apos;&#xd;\nWHEN 23791 THEN &apos;TDF+3TC+ATV/r&apos;&#xd;\nWHEN 6108 THEN &apos;TDF+3TC+LPV/r(2¬™ Linha)&apos;&#xd;\nWHEN 21163 THEN &apos;AZT+3TC+LPV/r(2¬™ Linha)&apos;&#xd;\nWHEN 23792 THEN &apos;ABC+3TC+ATV/r&apos;&#xd;\nWHEN 23793 THEN &apos;AZT+3TC+ATV/r&apos;&#xd;\nWHEN 1311 THEN &apos;ABC+3TC+LPV/r(2¬™ Linha)&apos;&#xd;\nWHEN 23790 THEN &apos;TDF+3TC+LPV/r+RTV&apos;&#xd;\nWHEN 23795 THEN &apos;ABC+3TC+ATV/r+RAL&apos;&#xd;\nWHEN 23796 THEN &apos;TDF+3TC+ATV/r+RAL&apos;&#xd;\nWHEN 6329 THEN &apos;TDF+3TC+RAL+DRV/r(3¬™ Linha)&apos;&#xd;\nWHEN 23797 THEN &apos;ABC+3TC++RAL+DRV/r&apos;&#xd;\nWHEN 23798 THEN &apos;3TC+RAL+DRV/r&apos;&#xd;\nWHEN 6100 THEN &apos;AZT+3TC+LPV/r&apos;&#xd;\nWHEN 6116 THEN &apos;AZT+3TC+ABC&apos;&#xd;\nWHEN 6106 THEN &apos;ABC+3TC+LPV/r&apos;&#xd;\nWHEN 6105 THEN &apos;ABC+3TC+NVP&apos;&#xd;\nWHEN 23801 THEN &apos;AZT+3TC+RAL&apos;&#xd;\nWHEN 23802 THEN &apos;AZT+3TC+DRV/r&apos;&#xd;\nWHEN 23815 THEN &apos;AZT+3TC+DTG&apos;&#xd;\nWHEN 23803 THEN &apos;AZT+3TC+RAL+DRV/r&apos;&#xd;\nELSE &apos;OUTRO&apos; END AS esquema,dataregime&#xd;\nFROM&#xd;\n(SELECT DISTINCT e.patient_id, MAX(e.encounter_datetime) AS dataregime&#xd;\nFROM obs o&#xd;\nINNER JOIN encounter e ON (e.patient_id = o.person_id AND `e`.`encounter_id` = `o`.`encounter_id`) &#xd;\nWHERE  e.encounter_type = 18&#xd;\nAND o.concept_id = 1088 AND o.voided = 0 AND e.voided=0 &#xd;\nGROUP BY e.patient_id&#xd;\n) ultimoregime&#xd;\nINNER JOIN encounter e ON ultimoregime.patient_id=e.patient_id AND ultimoregime.dataregime=e.encounter_datetime AND e.encounter_type = 18&#xd;\nINNER JOIN obs o ON e.encounter_id=o.encounter_id&#xd;\nWHERE e.voided=0 AND o.voided=0 AND o.concept_id=1088&#xd;\n) regime ON regime.patient_id=visita.patient_id          &#xd;\n/* BUSCA DO ULTIMO PEDIDO DE CV */	&#xd;\nLEFT JOIN&#xd;\n( SELECT DISTINCT ultimo_pedido.person_id AS patient_id,o.obs_datetime &#xd;\n  FROM&#xd;\n (SELECT o.person_id,MAX(o.obs_datetime) data_pedido&#xd;\n FROM encounter e INNER JOIN obs o ON e.encounter_id=o.encounter_id WHERE o.voided=0 AND o.concept_id=23722 AND o.value_coded=856 AND&#xd;\n e.voided=0 AND e.encounter_datetime &lt;=&apos;2021-06-20&apos; AND e.location_id=398&#xd;\n GROUP BY o.person_id&#xd;\n ) ultimo_pedido&#xd;\nINNER JOIN encounter e ON e.patient_id=ultimo_pedido.person_id&#xd;\nINNER JOIN obs o ON e.encounter_id=o.encounter_id WHERE o.voided=0 AND o.concept_id=23722 AND o.value_coded=856 AND&#xd;\ne.voided=0 AND ultimo_pedido.data_pedido=o.obs_datetime AND e.encounter_datetime &lt;=&apos;2021-06-20&apos; AND e.location_id=398&#xd;\n) pedido_CV ON pedido_CV.patient_id=inicio_real.patient_id&#xd;\n/* BUSCA DO ULTIMO CV */		&#xd;\nLEFT JOIN&#xd;\n( SELECT o.person_id AS patient_id, e.encounter_datetime,CASE MAX(o.value_coded)&#xd;\n				WHEN 1306 THEN &apos;Nivel baixo de detec√ß√£o&apos;&#xd;\n				WHEN 1304 THEN &apos;Fraca qualidade de amostra&apos;&#xd;\n				WHEN 23814 THEN &apos;Indetectavel&apos;&#xd;\n				WHEN 23905 THEN &apos;MENOR QUE 10 COPIAS/ML&apos;&#xd;\n				WHEN 23906 THEN &apos;MENOR QUE 20 COPIAS/ML&apos;&#xd;\n				WHEN 23907 THEN &apos;MENOR QUE 40 COPIAS/ML&apos;&#xd;\n				WHEN 23908 THEN &apos;MENOR QUE 400 COPIAS/ML&apos;&#xd;\n				WHEN 23904 THEN &apos;MENOR QUE 839 COPIAS/ML&apos;&#xd;\n				ELSE &apos;&apos; END AS qualidade_carga,MAX(o.value_numeric) value_numeric&#xd;\n  FROM  encounter e &#xd;\n  INNER JOIN obs o ON e.encounter_id=o.encounter_id &#xd;\n  INNER JOIN&#xd;\n  (SELECT p.patient_id, MAX(e.encounter_datetime) data_cv&#xd;\n   FROM patient p&#xd;\n   INNER JOIN encounter e ON p.patient_id=e.patient_id&#xd;\n   INNER JOIN obs o ON e.encounter_id=o.encounter_id&#xd;\n   WHERE 	p.voided=0 AND e.voided=0 AND o.voided=0 AND e.encounter_type IN (13,6,9,53) AND &#xd;\n		    o.concept_id IN (856,1305) AND (o.value_numeric IS NOT NULL OR o.value_coded IS NOT NULL) AND &#xd;\n		    e.encounter_datetime &lt;=&apos;2021-06-20&apos; AND e.location_id=398&#xd;\n   GROUP BY  p.patient_id               &#xd;\n  ) cv &#xd;\n  ON e.patient_id=cv.patient_id AND e.encounter_datetime=cv.data_cv &#xd;\n  WHERE e.voided=0 AND o.voided=0 AND o.concept_id IN (856,1305) AND (o.value_numeric IS NOT NULL OR o.value_coded IS NOT NULL) &#xd;\n  GROUP BY  o.person_id,e.encounter_datetime                  &#xd;\n) carga_viral ON carga_viral.patient_id=inicio_real.patient_id&#xd;\n&#xd;\n/* BUSCA DA DISPENSA ACTUAL-SEMESTRAL/TRIMESTRAL-PELA FICHA CLINICA OU APSS */ &#xd;\nLEFT JOIN&#xd;\n(SELECT DISTINCT disp.patient_id,disp.data_registo,disp2.tipo_dispensa,disp2.ficha_registo FROM&#xd;\n	(SELECT patient_id, MAX(data_registo) AS data_registo FROM&#xd;\n		(/*ficha clinica*/&#xd;\n		SELECT e.patient_id, &apos;DS&apos; AS tipo_dispensa,&apos;CLINICA&apos; ficha_registo, e.encounter_datetime data_registo FROM encounter e &#xd;\n		INNER JOIN obs o ON e.encounter_id = o.encounter_id					 &#xd;\n		WHERE encounter_type=6 AND o.concept_id = 23739 AND o.value_coded=23888 AND e.voided=0 AND o.voided=0 AND e.encounter_datetime &lt;= &apos;2021-06-20&apos;  AND e.location_id=398&#xd;\n		UNION&#xd;\n		/*ficha clinica*/&#xd;\n		SELECT e.patient_id, &apos;DT&apos; AS tipo_dispensa,&apos;CLINICA&apos; ficha_registo, e.encounter_datetime data_registo FROM encounter e &#xd;\n		INNER JOIN obs o ON e.encounter_id = o.encounter_id					 &#xd;\n		WHERE encounter_type=6 AND o.concept_id = 23739 AND o.value_coded=23720 AND e.voided=0 AND o.voided=0 AND e.encounter_datetime &lt;= &apos;2021-06-20&apos;  AND e.location_id=398&#xd;\n		UNION &#xd;\n		/*ficha clinica*/&#xd;\n		SELECT e.patient_id, &apos;DS&apos; AS tipo_dispensa,&apos;CLINICA&apos; ficha_registo, e.encounter_datetime data_registo FROM&#xd;\n		encounter e &#xd;\n		INNER JOIN obs o ON e.encounter_id = o.encounter_id					 &#xd;\n		WHERE encounter_type=6 AND o.concept_id = 23888 AND o.value_coded IN (1256,1257) AND e.voided=0 AND o.voided=0 AND e.encounter_datetime &lt;= &apos;2021-06-20&apos;  AND e.location_id=398&#xd;\n		UNION &#xd;\n		/*ficha clinica*/&#xd;\n		SELECT e.patient_id, &apos;DT&apos; AS tipo_dispensa,&apos;CLINICA&apos; ficha_registo, e.encounter_datetime data_registo FROM encounter e &#xd;\n		INNER JOIN obs o ON e.encounter_id = o.encounter_id					 &#xd;\n		WHERE encounter_type=6 AND o.concept_id = 23730 AND o.value_coded IN (1256,1257) AND e.voided=0 AND o.voided=0 AND e.encounter_datetime &lt;= &apos;2021-06-20&apos;  AND e.location_id=398&#xd;\n&#xd;\n		UNION&#xd;\n		/*ficha APSS*/&#xd;\n		SELECT e.patient_id, &apos;DS&apos; AS tipo_dispensa,&apos;APSS&apos; ficha_registo,e.encounter_datetime data_registo FROM encounter e &#xd;\n		INNER JOIN obs o ON e.encounter_id = o.encounter_id					 &#xd;\n		WHERE encounter_type IN (34,35) AND o.concept_id = 23888 AND o.value_coded IN (1256,1257) AND e.voided=0 AND o.voided=0 AND e.encounter_datetime &lt;= &apos;2021-06-20&apos;  AND e.location_id=398&#xd;\n		UNION&#xd;\n		/*ficha APSS*/&#xd;\n		SELECT e.patient_id, &apos;DT&apos; AS tipo_dispensa,&apos;APSS&apos; ficha_registo,e.encounter_datetime data_registo FROM encounter e &#xd;\n		INNER JOIN obs o ON e.encounter_id = o.encounter_id					 &#xd;\n		WHERE encounter_type IN (34,35) AND o.concept_id = 23730 AND o.value_coded IN (1256,1257) AND e.voided=0 AND o.voided=0 AND e.encounter_datetime &lt;= &apos;2021-06-20&apos;  AND e.location_id=398&#xd;\n&#xd;\n		) a GROUP BY patient_id&#xd;\n	) disp&#xd;\n	INNER JOIN&#xd;\n	(/*ficha clinica*/&#xd;\n	SELECT e.patient_id, &apos;DS&apos; AS tipo_dispensa,&apos;CLINICA&apos; ficha_registo, e.encounter_datetime data_registo FROM encounter e &#xd;\n	INNER JOIN obs o ON e.encounter_id = o.encounter_id					 &#xd;\n	WHERE encounter_type=6 AND o.concept_id = 23739 AND o.value_coded=23888 AND e.voided=0 AND o.voided=0 AND e.encounter_datetime &lt;= &apos;2021-06-20&apos;  AND e.location_id=398&#xd;\n	UNION&#xd;\n	/*ficha clinica*/&#xd;\n	SELECT e.patient_id, &apos;DT&apos; AS tipo_dispensa,&apos;CLINICA&apos; ficha_registo, e.encounter_datetime data_registo FROM encounter e &#xd;\n	INNER JOIN obs o ON e.encounter_id = o.encounter_id					 &#xd;\n	WHERE encounter_type=6 AND o.concept_id = 23739 AND o.value_coded=23720 AND e.voided=0 AND o.voided=0 AND e.encounter_datetime &lt;= &apos;2021-06-20&apos;  AND e.location_id=398&#xd;\n&#xd;\n	UNION &#xd;\n	/*ficha clinica*/&#xd;\n	SELECT e.patient_id, &apos;DS&apos; AS tipo_dispensa,&apos;CLINICA&apos; ficha_registo, e.encounter_datetime data_registo FROM encounter e &#xd;\n	INNER JOIN obs o ON e.encounter_id = o.encounter_id					 &#xd;\n	WHERE encounter_type=6 AND o.concept_id = 23888 AND o.value_coded IN (1256,1257) AND e.voided=0 AND o.voided=0 AND e.encounter_datetime &lt;= &apos;2021-06-20&apos;  AND e.location_id=398&#xd;\n	UNION &#xd;\n	/*ficha clinica*/&#xd;\n	SELECT e.patient_id, &apos;DT&apos; AS tipo_dispensa,&apos;CLINICA&apos; ficha_registo, e.encounter_datetime data_registo FROM encounter e &#xd;\n	INNER JOIN obs o ON e.encounter_id = o.encounter_id					 &#xd;\n	WHERE encounter_type=6 AND o.concept_id = 23730 AND o.value_coded IN (1256,1257) AND e.voided=0 AND o.voided=0 AND e.encounter_datetime &lt;= &apos;2021-06-20&apos;  AND e.location_id=398&#xd;\n	UNION &#xd;\n	/*ficha APSS*/&#xd;\n	SELECT e.patient_id, &apos;DS&apos; AS tipo_dispensa,&apos;APSS&apos; ficha_registo,e.encounter_datetime data_registo FROM encounter e &#xd;\n	INNER JOIN obs o ON e.encounter_id = o.encounter_id					 &#xd;\n	WHERE encounter_type IN (34,35) AND o.concept_id = 23888 AND o.value_coded IN (1256,1257) AND e.voided=0 AND o.voided=0 AND e.encounter_datetime &lt;= &apos;2021-06-20&apos;  AND e.location_id=398&#xd;\n	UNION&#xd;\n	/*ficha APSS*/&#xd;\n	SELECT e.patient_id, &apos;DT&apos; AS tipo_dispensa,&apos;APSS&apos; ficha_registo,e.encounter_datetime data_registo FROM encounter e &#xd;\n	INNER JOIN obs o ON e.encounter_id = o.encounter_id					 &#xd;\n	WHERE encounter_type IN (34,35) AND o.concept_id = 23730 AND o.value_coded IN (1256,1257) AND e.voided=0 AND o.voided=0 AND e.encounter_datetime &lt;= &apos;2021-06-20&apos;  AND e.location_id=398&#xd;\n	) disp2 ON disp.patient_id=disp2.patient_id AND disp.data_registo=disp2.data_registo&#xd;\n) disp_registo ON disp_registo.patient_id=inicio_real.patient_id&#xd;\n/* BUSCA DA DISPENSA ACTUAL-SEMESTRAL/TRIMESTRAL-PELO FILA */ &#xd;\nLEFT JOIN&#xd;\n(SELECT max_frida.patient_id, o1.value_numeric quantidade,e.encounter_datetime data_ultimo_levantamento,o.value_datetime data_proximo_levantamento FROM&#xd;\n	(SELECT p.patient_id,MAX(encounter_datetime) data_dispensa&#xd;\n	FROM 	patient p &#xd;\n	INNER JOIN encounter e ON e.patient_id=p.patient_id&#xd;\n	WHERE 	p.voided=0 AND e.voided=0 AND e.encounter_type = 18 AND e.encounter_datetime &lt;= &apos;2021-06-20&apos;  AND e.location_id=398&#xd;\n	GROUP BY p.patient_id&#xd;\n	) max_frida &#xd;\nINNER JOIN encounter e ON max_frida.patient_id=e.patient_id AND max_frida.data_dispensa=e.encounter_datetime&#xd;\nINNER JOIN obs o ON e.encounter_id = o.encounter_id AND o.concept_id = 5096 AND ((DATEDIFF(o.value_datetime,e.encounter_datetime) BETWEEN 162 AND 198) OR (DATEDIFF(o.value_datetime,e.encounter_datetime) BETWEEN 81 AND 99)) AND o.voided=0&#xd;\nLEFT JOIN obs o1 ON e.encounter_id =o1.encounter_id AND o1.concept_id=1715 AND o1.voided=0&#xd;\n) disp_fila ON disp_fila.patient_id=inicio_real.patient_id&#xd;\n/* VERIFICACAO DO ESTADO DE GRAVIDEZ */ &#xd;\nLEFT JOIN&#xd;\n(SELECT	p.patient_id,e.encounter_datetime&#xd;\n FROM 	patient p &#xd;\n INNER JOIN encounter e ON p.patient_id=e.patient_id&#xd;\n INNER JOIN obs o ON e.encounter_id=o.encounter_id&#xd;\n WHERE p.voided=0 AND e.voided=0 AND o.voided=0 AND concept_id=1982 AND value_coded IN (44,1065) AND e.encounter_type IN (5,6) &#xd;\n  AND e.encounter_datetime BETWEEN DATE_ADD(&apos;2021-06-20&apos;, INTERVAL -10 MONTH) AND &apos;2021-06-20&apos; AND e.location_id=398&#xd;\n UNION&#xd;\n SELECT p.patient_id,e.encounter_datetime&#xd;\n FROM 	patient p &#xd;\n INNER JOIN encounter e ON p.patient_id=e.patient_id&#xd;\n INNER JOIN obs o ON e.encounter_id=o.encounter_id&#xd;\n WHERE p.voided=0 AND e.voided=0 AND o.voided=0 AND concept_id=1982 AND value_coded=1065 AND e.encounter_type =53 &#xd;\n AND e.encounter_datetime BETWEEN DATE_ADD(&apos;2021-06-20&apos;, INTERVAL -10 MONTH) AND &apos;2021-06-20&apos; AND e.location_id=398&#xd;\n&#xd;\nUNION	&#xd;\n		&#xd;\nSELECT 	p.patient_id,e.encounter_datetime&#xd;\nFROM 	patient p INNER JOIN encounter e ON p.patient_id=e.patient_id&#xd;\nINNER JOIN obs o ON e.encounter_id=o.encounter_id&#xd;\nWHERE 	p.voided=0 AND e.voided=0 AND o.voided=0 AND concept_id=1279 AND &#xd;\n	e.encounter_type IN (5,6) AND e.encounter_datetime BETWEEN DATE_ADD(&apos;2021-06-20&apos;, INTERVAL -10 MONTH) AND &apos;2021-06-20&apos; AND e.location_id=398&#xd;\n&#xd;\nUNION		&#xd;\n				&#xd;\nSELECT 	p.patient_id,e.encounter_datetime&#xd;\nFROM 	patient p INNER JOIN encounter e ON p.patient_id=e.patient_id&#xd;\nINNER JOIN obs o ON e.encounter_id=o.encounter_id&#xd;\nWHERE 	p.voided=0 AND e.voided=0 AND o.voided=0 AND concept_id=1600 AND &#xd;\n	e.encounter_type IN (5,6) AND e.encounter_datetime BETWEEN DATE_ADD(&apos;2021-06-20&apos;, INTERVAL -10 MONTH) AND &apos;2021-06-20&apos; AND e.location_id=398		&#xd;\n				&#xd;\nUNION&#xd;\nSELECT 	pp.patient_id,pp.date_enrolled encounter_datetime&#xd;\nFROM 	patient_program pp &#xd;\nWHERE 	pp.program_id=8 AND pp.voided=0 AND &#xd;\npp.date_enrolled BETWEEN DATE_ADD(&apos;2021-06-20&apos;, INTERVAL -10 MONTH) AND &apos;2021-06-20&apos; AND pp.location_id=398&#xd;\n) gravida ON gravida.patient_id=inicio_real.patient_id&#xd;\nWHERE ROUND(DATEDIFF(&apos;2021-06-20&apos;,p.birthdate)/365) BETWEEN 0 AND 17 </sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2021-09-14 07:58:07',1,'2021-09-15 10:16:15',1,0,NULL,NULL,NULL,'1a792c80-6619-4952-81d3-2c6d7a506e95') ON DUPLICATE KEY UPDATE uuid= '1a792c80-6619-4952-81d3-2c6d7a506e95';

